Het doel van de stichting wordt als volgt omschreven:  


het bevorderen van de terugschakeling van daarvoor in aanmerking komende politieke delinquenten met hun gezin naar normale verhoudingen in de ruimste zin des woords;


het geven van voorlichting aan de rechter en het openbaar ministerie in die politieke zaken, met inbegrip van tribunaalzaken, betrekking hebbende op feiten, die gepleegd zijn gedurende de tijd van de Duitse bezetting;


ter bevordering van het sub a) omschreven doel het geven van voorlichting op dat terrein aan de publieke opinie en het verlenen van hulp en het deelnemen aan voor de heropvoeding noodzakelijke werkzaamheden.
